// import img from "./image/b2.jpg"

const App = () => {
  const [input, setInput] = useState()

  
  return (
    <>
    <form >

    <input type="text" 
      placeholder="Enter Your Name"
      value={input}
    />
    <input type="submit"  />
    </form>
        
    </>
  )
}

export default App
